import React from "react";
import { Box, Typography, Card, CardContent, CardMedia } from "@mui/material";

const Portfolio: React.FC = () => {
    return (
        <Box
            sx={{
                width: "100%",
                minHeight: "100vh",
                backgroundColor: "#FFEEEE", // Light pink background
                padding: "4rem 2rem",
                display: "flex",
                flexDirection: "column",
                alignItems: "center",
                gap: "2rem",
            }}
        >
            {/* Page Title */}
            <Typography
                variant="h3"
                sx={{
                    color: "#4A2040", // Dark purple
                    fontWeight: "bold",
                    marginBottom: "2rem",
                }}
            >
                My Portfolio
            </Typography>

            {/* Project Card 1 */}
            <Card
                sx={{
                    display: "flex",
                    width: "80%",
                    backgroundColor: "#FFFFFF",
                    borderRadius: "16px",
                    boxShadow: "0 4px 8px rgba(0, 0, 0, 0.1)",
                    overflow: "hidden",
                }}
            >
                {/* Project Image */}
                <CardMedia
                    component="img"
                    image="path_to_misspoppins_image.png" // Replace with actual image path
                    alt="MissPoppins App Redesign"
                    sx={{
                        width: "40%",
                    }}
                />

                {/* Project Details */}
                <CardContent
                    sx={{
                        padding: "2rem",
                        flex: "1",
                    }}
                >
                    <Typography
                        variant="h5"
                        sx={{
                            color: "#4A2040",
                            fontWeight: "bold",
                            marginBottom: "1rem",
                        }}
                    >
                        MissPoppins App Redesign
                    </Typography>
                    <Typography
                        variant="subtitle1"
                        sx={{
                            color: "#6B3258", // Slightly lighter purple
                            marginBottom: "1rem",
                        }}
                    >
                        Simplifying Navigation and Boosting User Engagement
                    </Typography>
                    <Typography
                        variant="body2"
                        sx={{
                            color: "#4A2040",
                            marginBottom: "1rem",
                        }}
                    >
                        Streamlined navigation and introduced strategic pricing to enhance the coach-client experience.
                    </Typography>
                    <Typography
                        variant="body2"
                        sx={{
                            color: "#4A2040",
                            marginBottom: "0.5rem",
                            fontWeight: "bold",
                        }}
                    >
                        Role:
                    </Typography>
                    <Typography
                        variant="body2"
                        sx={{
                            color: "#4A2040",
                            marginBottom: "1rem",
                        }}
                    >
                        UX Researcher, UX/UI Designer
                    </Typography>
                    <Typography
                        variant="body2"
                        sx={{
                            color: "#4A2040",
                            fontWeight: "bold",
                        }}
                    >
                        Toolkit:
                    </Typography>
                    <Typography
                        variant="body2"
                        sx={{
                            color: "#4A2040",
                        }}
                    >
                        Figma, FigJam, Pencil and Paper
                    </Typography>
                </CardContent>
            </Card>

            {/* Add More Project Cards Here */}
            {/* Example for another project card */}
            {/* 
            <Card>
                <CardMedia component="img" ... />
                <CardContent>
                    <Typography>...</Typography>
                </CardContent>
            </Card> 
            */}

        </Box>
    );
};

export default Portfolio;
